import React, { Fragment } from 'react';

const MovieList = (props) => {

    return (
        <Fragment>
            {props.movies.map((movie) => (
        <Movie
          key={movie.id}
          title={movie.title}
          releaseDate={movie.releaseDate}
          openingText={movie.openingText}
        />
      ))}
        </Fragment>
    );
};

export default MovieList;
